import { Pipe, PipeTransform } from '@angular/core';
import moment = require('moment');

@Pipe({
  name: 'customTime',
})
export class CustomTimePipe implements PipeTransform {

  transform(value: any, ...args: any[]): any {
    return moment(value, 'HH:mm A').format("HH:mm:ss");


  }

}
